import React, { useState } from 'react'
import TextField from '@material-ui/core/TextField';


const AddUser = () => {
  return (
    <div>

      <form noValidate autoComplete='off'>
        <TextField
          name='name'
          type='text'
          value={name}
         />
      </form>
    </div>
  )
}

export default AddUser
